import React from "react";
import {
  Text,
  Flex,
  Box,
  VStack,
  HStack,
  Icon,
  Badge,
  Spacer,
  Divider,
  Pressable,
  Button,
  Center,
  Input,
} from "native-base";
import RidersCard from "../../../_shared/libs/Riders_MoneyFlow_Card";
import { Entypo, SimpleLineIcons, AntDesign } from "@expo/vector-icons";

const Login = () => {
  return (
    <Box w="100%" flex={1} backgroundColor="#F6F5F5" px="8" pt="60px">
      <Center mt={12}>SendMe Logo</Center>
      <Box mt={16}>
        <HStack>
          <Text fontWeight="extrabold" fontSize="bs" color="col.default">
            Sign
          </Text>
          <VStack>
            <Text
              pl="5px"
              fontWeight="extrabold"
              fontSize='25px'
              color="col.default"
            >
              Up
            </Text>
            <Divider borderRadius="3" thickness="2" bg="#f00" />
          </VStack>
        </HStack>
        <Text mt={4}>Confirm your details and create password</Text>
      </Box>

      <VStack space={10} mt={12} mb={16}>
        <Box>
          <Text pl="2">Full Name</Text>
          <Input variant="underlined" h={6} px="2" />
        </Box>

        <Box>
          <Text pl="2">Mobile Number</Text>

          <Input variant="underlined" h={6} px="2" />
        </Box>

        <Box>
          <Text pl="2">Email Address</Text>

          <Input variant="underlined" h={6} px="2" />
        </Box>

        <Box>
          <Text pl="2">Create Password</Text>

          <Input variant="underlined" h={6} px="2" />
        </Box>

        <Box>
          <Text pl="2">Confirm Password</Text>

          <Input
            variant="underlined"
            h={6}
            px="2"
            fontSize="18px"
            fontWeight="bold"
          />
        </Box>
      </VStack>
      <Button bgColor={"col.500"} height="56px" borderRadius="12px">
        Done and Confirm
      </Button>
    </Box>
  );
};

export default Login;
